# Import libraries

import pygame, time, sys, numba, tkinter, tkinter.filedialog
from numpy import sin, cos, sqrt, mean

tinyNumber = 0.1 # Number to prevent division by zero

@numba.njit() # numba optimization
def projectPoint(pointX, pointY, pointZ, camX, camY, camZ, camrX, camrY, camrZ, focalLength):
    'Takes in a 3D point and projects it into 2D space'
    # This math is based on the 3D Projection math (No matrices one) from https://en.wikipedia.org/wiki/3D_projection
    x = pointX - camX
    y = pointY - camY
    z = pointZ - camZ
    sx = sin(camrX)
    sy = sin(camrZ)
    sz = sin(camrY)
    cx = cos(camrX)
    cy = cos(camrY)
    cz = cos(camrZ)
    dx = cy*(sz*y + cz*x)-sy*z
    dy = sx*(cy*z + sy*(sz*y + cz*x))+cx*(cz*y - sz*x)
    dz = cx*(cy*z+sy*(sz*y+cz*x)) - sx*(cz*y - sz*x)
    bx = focalLength/(dz+tinyNumber) * dx
    by = focalLength/(dz+tinyNumber) * dy
    return [bx, by]

def key(e):
    return e[0]

def sortTrianges(triangles, camX, camY, camZ):
    output0 = []
    index = 0
    for triangle in triangles:
        xs, ys, zs = [], [], []
        for point in triangle:
            xs.append(point[0])
            ys.append(point[1])
            zs.append(point[2])
        x, y, z = mean(xs), mean(ys), mean(zs)
        x, y, z = x - camX, y - camY, z - camZ
        distance = sqrt(x**2 + y**2 + z**2)
        output0.append([distance, triangle])
        index += 1
    output0.sort(key=key, reverse=True)
    output = []
    for out in output0:
        output.append(out[1])
    return output

def promptFile():
    # Open file select prompt
    top = tkinter.Tk()
    top.withdraw()
    file_name = tkinter.filedialog.askopenfilename(parent=top, filetypes=(("Waveform 3D Models", "*.obj"), ), title="Choose a 3D Model")
    top.destroy()
    if file_name != "":return file_name
    return ""

def read_obj(fileName):
    vertices, triangles = [], []

    with open(fileName) as f: # Open obj file
        for line in f.readlines():

            splitted = line.split()

            if len(splitted) == 0:
                continue

            if splitted[0] == "v":
                vertices.append(splitted[1:4]) # Vertices

            elif splitted[0] == "f": # Face

                if len(splitted[1].split("/")) == 1:
                    triangles.append([splitted[1], splitted[2], splitted[3]])

                    if len(splitted) > 4:
                        triangles.append([splitted[1], splitted[3], splitted[4]])

                else: # Quad
                    p1 = splitted[1].split("/")
                    p2 = splitted[2].split("/")
                    p3 = splitted[3].split("/")
                    triangles.append([p1[0], p2[0], p3[0]])
                    
                    if len(splitted) > 4:
                        p4 = splitted[4].split("/")
                        triangles.append([p1[0], p3[0], p4[0]])
    
    vertices = [list(map(float, sublist)) for sublist in vertices]
    triangles = [list(map(int, sublist)) for sublist in triangles]
    output = []
    for triangle in triangles:
        for point in triangle:
            output.append(vertices[point-1])
    output = list(zip(*[iter(output)]*3))
    return output

class Object:
    def __init__(self, triangles):
        self.tris = triangles # List of base triangles
        self.triangles = triangles # Triangles based on x, y, and z values
        self.x = 0
        self.y = 0
        self.z = 0
    def callOnUpdatePos(self):
        "Updates the triangle positions based on the x, y, and z values"
        # Adds the x, y, and z values to the self.tris values and outputs it in self.triangles
        output = []
        for triangle in self.tris:
            triangle0 = []
            for point in triangle:
                point0 = []
                point0.append(point[0] + self.x)
                point0.append(point[1] + self.y)
                point0.append(point[2] + self.z)
                triangle0.append(point0)
            output.append(triangle0)
        self.triangles = output

class RigidBody:
    def __init__(self, gravity=True):
        self.gravity = gravity
    def checkCollision(self, a, b, sepecifyAxes):
        if sepecifyAxes == True: # If the axes is wanted then declare variables
            collX = False
            collY = False
            collZ = False
        # Generate max and min x, y, z values for a and b. math on https://developer.mozilla.org/en-US/docs/Games/Techniques/3D_collision_detection
        for at in a.triangles:
            for bt in b.triangles:
                axs = [];ays = [];azs = []
                for point in at:
                    axs.append(point[0])
                    ays.append(point[1])
                    azs.append(point[2])
                    amaxX = max(axs)
                aminX = min(axs)
                amaxY = max(ays)
                aminY = min(ays)
                amaxZ = max(azs)
                aminZ = min(azs)
                bxs = [];bys = [];bzs = []
                for point in bt:
                    bxs.append(point[0])
                    bys.append(point[1])
                    bzs.append(point[2])
                bmaxX = max(bxs)
                bminX = min(bxs)
                bmaxY = max(bys)
                bminY = min(bys)
                bmaxZ = max(bzs)
                bminZ = min(bzs)
                if sepecifyAxes == False:
                    if aminX <= bmaxX and amaxX >= bminX and aminY <= bmaxY and amaxY >= bminY and aminZ <= bmaxZ and amaxZ >= bminZ:
                        return True
                else:
                    if aminX <= bmaxX and amaxX >= bminX:
                        collX = True
                    if aminY <= bmaxY and amaxY >= bminY:
                        collY = True
                    if aminZ <= bmaxZ and amaxZ >= bminZ:
                        collZ = True
        # Return coliding or coliding on axes
        if sepecifyAxes == False:
            return False
        else:
            return collX, collY, collZ
    def move(self, x, y, z, object, otherObjects):
        # Get colisions on axes for overiding
        cx, cy, cz = self.checkCollision(object, otherObjects[0], True)
        for otherObject in otherObjects:
            ux, uy, uz = cx, cy, cz # Declare vars for the overide
            cx, cy, cz = self.checkCollision(object, otherObject, True) # Get colisions on axes
            # Overide based of prev
            if cx == False and ux == True:
                cx = True
            if cy == False and uy == True:
                cy = True
            if cz == False and uz == True:
                cz = True
        # If the colliding on axes then dont move otherwise move
        if cx == False:
            object.x += x
        if cy == False:
            object.y += y
        if cz == False:
            object.z += z

class Engine:
    def __init__(self, window, width, height):
        # Declare variables
        self.width = width
        self.height = height
        self.window = window

        self.posX = 0
        self.posY = 0
        self.posZ = 0
        self.rotX = 0
        self.rotY = 0
        self.rotZ = 0
    def draw(self, triangles):
        index = 0 # Set index of triangles to zero
        triangles = sortTrianges(triangles, self.posX, self.posY, self.posZ)
        camera = Object([[[0, 0, 0], ], ])
        camera.x = self.posX
        camera.y = self.posY
        camera.z = self.posZ
        camera.callOnUpdatePos()
        cameraRigidBody = RigidBody(camera)
        if cameraRigidBody.checkCollision(camera, Object(triangles), False) == False:
            for triangle in triangles:
                index += 1 # Increment the index
                positions = [] # Positions for current triangle
                for point in triangle:
                    point2d = projectPoint(point[0], point[1], point[2], self.posX, self.posY, self.posZ, self.rotX, self.rotY, self.rotZ, 90) # Get output from projectPoint() method
                    point2d[0] += self.width/2 # Center the points
                    point2d[1] += self.height/2 # Center the points
                    positions.append(point2d) # Append the point in 2D to the positions list
                # Generate Color
                color = list(index*(i+1) for i in range(3))
                if color[0] > 255:
                    index = 0
                    color[0] = 0
                if color[1] > 255:
                    index = 0
                    color[1] = 0
                if color[2] > 255:
                    index = 0
                    color[2] = 0
                pygame.draw.polygon(self.window, color, positions) # Draw the triangle to the screen
    
    def movement(self, keys, deltaTime):
        # Move the camera using the given keys
        if keys[pygame.K_w]:
            self.posZ += 1 * deltaTime
        if keys[pygame.K_s]:
            self.posZ -= 1 * deltaTime
        if keys[pygame.K_a]:
            self.posX -= 1 * deltaTime
        if keys[pygame.K_d]:
            self.posX += 1 * deltaTime
        if keys[pygame.K_q]:
            self.posY += 1 * deltaTime
        if keys[pygame.K_e]:
            self.posY -= 1 * deltaTime
        if keys[pygame.K_UP]:
            self.rotX += 0.5 * deltaTime
        if keys[pygame.K_DOWN]:
            self.rotX -= 0.5 * deltaTime
        if keys[pygame.K_LEFT]:
            self.rotZ -= 0.5 * deltaTime
        if keys[pygame.K_RIGHT]:
            self.rotZ += 0.5 * deltaTime

